import "./Reviews.css";
import axios from "axios";

export const Reviews = ({ id }) => {
  const {data} = axios.get(`http://localhost:4000/reviews`);
  const review = data?.data.filter( review => {
    return review.id === id;
  });
  return (
    <div className="review">
      {
        review.map(review => {
          return <div key={review.reviewId}>
            <h3>{review.name}</h3>
            <p>{review.email}</p>
            <p>{review.review}</p>
            <p>{review.rating}</p>
          </div>
        })
        // console.log(review)
      }
    </div>
  )
}
